https://ribeirovidal.com/recipes/bacalha.body:
Ingredients

Bacalhau dessalgado congelado
Batata
Pimentão
Cebola
Ovo
Azeitona
Tomate
Azeite
Alho

Instructions

Cozinhar as batatas e os ovos e aferventar o bacalhau;
Desfiar o bacalhau em pétalas, cortar as batatas em rodelas e descascar os ovos cozidos;
Fazer uma base de azeite na travessa e empilhar rodelas dos ingredientes;

Colocar o alho na primeira camada, para ele estar submerso no azeite;
Ir salgando os ingredientes ao longo da montagem;


Colocar no forno coberto por papel alumínio por 40 min;
Tirar o papel alumínio, adicionar os ovos, colocar mais um pouquinho de azeite por cima e finalizar no forno até borbulhar.

